Информация для студентов и педагогов ИИТ им. Е.Ф.Драгунова: 

Яна Сергеевна, педагог-психолог. Кабинет №31 (возле библиотеки). Подойдите лично или напишите мне сообщение.

Режим работы в техникуме: 
Пн, Вт, СР, Чт, Пт с 8.00
Ко мне можно обратиться, если: 
1. Стресс, переживания, апатия, депрессия; 
2. Проблемы в семейных отношениях; 
3. Переживания из-за учебы; 
4. Страхи, сомнения, навязчивые мысли; 
5. Проблемы в отношениях с людьми
и прочее.
